<p>This tab lists the users who have clicked at least one link in the message.</p><table><tr><td>Heading</td><td>This shows the message ID and subject, and the list or lists to which the message has been sent</td></tr><tr><td>Download</td><td>The fields displayed can be downloaded as a CSV file.</td></tr><tr><td>User email</td><td>The email address of the user. It is a link to the User History page that shows the clicks by the user for each message.</td></tr><tr><td>User attributes</td><td>Each user attribute that has been selected is displayed in a separate column.</td></tr><tr><td>Links clicked</td><td>This is the number of links in the message that have been clicked by the user. A user clicking the same link twice is counted only once.The value is a link to the User Click Details page that shows the links clicked and the total clicks.</td></tr><tr><td>Total clicks</td><td>The number of individual clicks of links in the message by the user.</td></tr></table>